const SocialIcons = () => {
  const styles = {
    icon: {
      textDecoration: "none",
      fontSize: "22px",
      padding: "10px",
      transition: "0.2s ease-in",
      fontColor: "#fff",
    },

    xicon: {
        textDecoration: "none",
        fontSize: "22px",
        padding: "10px",
        transition: "0.2s ease-in",
        fontColor: "#fff",
    }
  };

  return (
    <div className="socialIcons" style={styles.socialIcons}>
      <a className="icon" style={styles.icon} href="https://github.com/mdyeates">
        <i className="fa-brands fa-github" aria-hidden="true" title="Michael Yeates' GitHub Profile"></i>
      </a>
      <a className="icon" style={styles.icon} href="https://www.linkedin.com/in/jleepro/">
        <i className="fa-brands fa-linkedin" aria-hidden="true" title="Joe Lee's LinkedIn Profile"></i>
      </a>
      <a className="icon" style={styles.icon} href="https://www.instagram.com/michael.yeates/">
        <i className="fa-brands fa-instagram" aria-hidden="true" title="Michael Yeates' Instagram Profile"></i>
      </a>
      <a className="icon" style={styles.xicon} href="https://twitter.com/j_leepro">
        <i className="fa-brands fa-x-twitter" aria-hidden="true" title="Joe Lee's Twitter Profile"></i>
        <i className="fa-brands fa-x-twitter" aria-hidden="true" title="Joe Lee's Twitter Profile"></i>
      </a>
    </div>
  );
};

export default SocialIcons;
